  `product_amount` decimal(10,2) NOT NULL COMMENT '商品金额',
  `delivery_fee` decimal(10,2) NOT NULL COMMENT '配送费',
  `trade_no` varchar(36) DEFAULT NULL COMMENT '外部订单号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='订单支付详情';
